import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
  return (
    <div className="bg-[#F3F4F6] h-[5em]">
      <div className="flex flex-row justify-between  ml-5">
        <div className="text-[#16174F] text-xl text-center font-semibold pt-5">
          Parshav Holdings
        </div>
        <div>
          <ol className="bg-red-500 ">
            <li>
              <NavLink
                to="dashboard"
                style={({ isActive }) => ({
                  background: isActive ? "#F3F3F6" : "",
                  color: isActive ? "#16174F" : "#FFFFFF",
                })}
                className="flex items-center rounded-l-full p-4 pl-8"
              >
                <li>Dashboard</li>
              </NavLink>
              <NavLink
                to="addDocket"
                style={({ isActive }) => ({
                  background: isActive ? "#F3F3F6" : "",
                  color: isActive ? "#16174F" : "#FFFFFF",
                })}
                className="flex items-center rounded-l-full p-4 pl-8"
              >
                <li>Add Docket</li>
              </NavLink>
            </li>
          </ol>
        </div>
      </div>
    </div>
  );
}

export default NavBar;
